(1, 'CONTACTUS', 'html', 'Job Seeker', 'Active', 'Contact Us Form Details', '<b>Dear Administrator,</b><br />\n<br />\n#Contact_Name# has filled contact us form<br />\n<br />\nBelow is the details.<br />\n<br />\n<b>Name :</b> #Contact_Name#<br />\n<br />\n<b>Phone :</b> #Contact_Phone#<br />\n<br />\n<b>Email :</b> #Contact_Email#<br />\n<br />\n<b>Subject :</b> #Contact_Subject#<br />\n<br />\n<b>\nMessage :</b> #Contact_Message#<br />\n<br /></br>\nThanks!  #MailFooter#', 'Fale Conosco Detalhes do Formulário', 'Cher administrateur,<br />\n<br />\n#Contact_Name# a rempli le formulaire de contact nous<br />\n<br />\nCi-dessous les détails.<br />\n<br />\nnom : #Contact_Name#<br />\n<br />\ntéléphone : #Contact_Phone#<br />\n<br />\nemail : #Contact_Email#<br />\n<br />\nsujet : #Contact_Subject#<br />\n<br />\nmessage : #Contact_Message#<br />\n<br />\nMerci!  #MailFooter#'),
(34, 'DRIVER_REGISTRATION_ADMIN', 'html', 'Job Seeker', 'Active', 'Packer registration on nexfret', '<p>Dear Administrator,</p>\r\n<p>New Packer is successfully registered at nexfret Registration details are as follows.</p>\r\n<p>Name :: #NAME#<br />\r\n<br />\r\nEmail :: #EMAIL#</p>\r\n<p>Thanks!  #MAILFOOTER#<br />\r\n</p>', 'Registro do Provedor de Serviços no nexfret', '<p>Dear Administrator,</p>\r\n<p>New Driver is successfully registered at nexfret Registration details are as follows.</p>\r\n<p>Name :: #NAME#<br />\r\n<br />\r\nEmail :: #EMAIL#</p>\r\n<p>Thanks!  #MAILFOOTER#<br />\r\n</p>'),
(4, 'CUSTOMER_FORGETPASSWORD', 'html', 'Job Seeker', 'Active', 'Password Request', '<p>Dear #Name#,</p>\r\n<p>Below is the requested email and the password.</p>\r\n<p>Email&nbsp; : #Email#</p>\r\n<p>Password&nbsp; : #Password#</p>\r\n<p>We look forward to a long association with you.</p>\r\n<p>Thanks!&nbsp; #MailFooter#</p>', 'Solicitação de senha', 'Cher #Name#,<br />\r\n<br />\r\nCi-dessous l\'email et le mot de passe demand&eacute;,<br />\r\n<br />\r\nEmail: #Email#<br />\r\n<br />\r\nMot de passe: #Password#<br />\r\n<br />\r\nNous nous r&eacute;jouissons d\'une longue association avec vous. <br />\r\n<br />\r\nMerci!  #MailFooter#'),
(5, 'MEMBER_REGISTRATION_USER', 'html', 'Job Seeker', 'Active', 'Member registration on nexfret', '<p>Dear&nbsp; #NAME#,</p><p>Welcome, you are successfully registered on nexfret. Your login details are as follows.</p><p>Email&nbsp; :&nbsp; #EMAIL#</p><p>Password&nbsp; :&nbsp; #PASSWORD#</p><p>#MAILFOOTER#</p>', 'Registro de membro no nexfret', '<p>Dear&nbsp; #NAME#,</p><p>Welcome, you are successfully registered on nexfret. Your login details are as follows.</p><p>Email&nbsp; :&nbsp; #EMAIL#</p><p>Password&nbsp; :&nbsp; #PASSWORD#</p><p>#MAILFOOTER#</p>'),
(31, 'DOCCUMENT_UPLOAD', 'html', 'Job Seeker', 'Active', 'Packer Documents Uploads details', 'Dear Administrator, <br />\n<br />\n#Company# has Uploaded all Documents. Below is the details. <br />\n<br />\nUsername : #Name#<br />\n<br />\nEmail : #Email# <br />\n<br />\nRegards,<br />\n<br />\n#SITE_FOOTER#', 'Documentos do fornecedor de serviços', 'Cher administrateur,<br />\n<br />\nL\'utilisateur a envoy&eacute; compte demande de suppression. Ci-dessous les d&eacute;tails.<br />\n<br />\nNom d\'utilisateur : #Name#<br />\n<br />\nemail : #Email#<br />\n<br />\nCordialement,<br />\n<br />\n#SITE_FOOTER#<br />'),
(27, 'RIDER_INVOICE', 'html', 'Job Seeker', 'Active', 'Recibos Nexfret', '#details#', 'Recibos Nexfret', '#details#<br />'),
(30, 'ACCOUNT_STATUS', 'html', 'Job Seeker', 'Active', 'Your Account Details', '<p>Dear&nbsp; #NAME#,</p>Email: #EMAIL#,<p>. Your Status as follows.</p>#details#<p>#MAILFOOTER#</p>', 'Your Account Details', '#details#<br />'),
(32, 'PROFILE_UPLOAD', 'html', 'Job Seeker', 'Active', ' Documents Uploads details', 'Dear Administrator, <br />\n<br />\n#USER# has Uploaded all Documents. Below is the details. <br />\n<br />\nUsername : #Name#<br />\n<br />\nEmail : #Email# <br />\n<br />\nRegards,<br />\n<br />\n#SITE_FOOTER#', 'Documentos Detalhes do upload', 'Cher administrateur,<br />\n<br />\nL\'utilisateur a envoy&eacute; compte demande de suppression. Ci-dessous les d&eacute;tails.<br />\n<br />\nNom d\'utilisateur : #Name#<br />\n<br />\nemail : #Email#<br />\n<br />\nCordialement,<br />\n<br />\n#SITE_FOOTER#<br />'),
(33, 'VEHICLE_BOOKING', 'html', 'Job Seeker', 'Active', 'Your Vehicle Details', '<p>Dear&nbsp; #NAME#,</p>Email: #EMAIL#,<p>. Your Status as follows.</p>#details#<p>#MAILFOOTER#</p>', 'Your Account Details', '#details#<br />'),
(35, 'COMPANY_REGISTRATION_ADMIN', 'html', 'Job Seeker', 'Active', 'Company registration on nexfret', '<p>Dear Administrator,</p>\r\n<p>New Company is successfully registered at nexfret Registration details are as follows.</p>\r\n<p>Name :: #NAME#<br />\r\n<br />\r\nEmail :: #EMAIL#</p>\r\n<p>Thanks!  #MAILFOOTER#<br />\r\n</p>', 'Company registration on nexfret', '<p>Dear Administrator,</p>\r\n<p>New Company is successfully registered at nexfret Registration details are as follows.</p>\r\n<p>Name :: #NAME#<br />\r\n<br />\r\nEmail :: #EMAIL#</p>\r\n<p>Thanks!  #MAILFOOTER#<br />\r\n</p>'),
(36, 'DRIVER_REGISTRATION_USER', 'html', 'Job Seeker', 'Active', 'Nexfret - Cadastro freteiro', '<p>Dear  #NAME#,</p><p>Welcome, you are successfully registered on nexfret. Your login details are as follows.</p><p>Email  :  #EMAIL#</p><p>Password  :  #PASSWORD#</p><p>#MAILFOOTER#</p>', 'Nexfret - Cadastro freteiro', '<p>Dear  #NAME#,</p><p>Welcome, you are successfully registered on nexfret. Your login details are as follows.</p><p>Email  :  #EMAIL#</p><p>Password  :  #PASSWORD#</p><p>#MAILFOOTER#</p>'),
(37, 'COMPANY_REGISTRATION_USER', 'html', 'Job Seeker', 'Active', 'Company registration on nexfret', '<p>Dear&nbsp; #NAME#,</p><p>Welcome, you are successfully registered on nexfret. Your login details are as follows.</p><p>Email&nbsp; :&nbsp; #EMAIL#</p><p>Password&nbsp; :&nbsp; #PASSWORD#</p><p>#MAILFOOTER#</p>', 'Company registration on nexfret', '<p>Dear&nbsp; #NAME#,</p><p>Welcome, you are successfully registered on nexfret. Your login details are as follows.</p><p>Email&nbsp; :&nbsp; #EMAIL#</p><p>Password&nbsp; :&nbsp; #PASSWORD#</p><p>#MAILFOOTER#</p>'),
(38, 'MANUAL_TAXI_DISPATCH_DRIVER', 'html', 'Job Seeker', 'Active', 'Your booking details', '<b>Dear #Driver#,</b><br />\n<br />\nYou are booked for service with <b>#Rider#.</b><br />\n<br />\nBelow is the details.<br />\n<br />\n<b>Rider Name :</b> #Rider#<br />\n<br />\n<b>Booking No :</b> #BookingNo#<br />\n<br />\n<b>From Address :</b> #SourceAddress#<br />\n<br />\n<b>To Address :</b> #DestinationAddress#<br />\n<br />\n<b>Booking Date :</b> #Ddate#<br />\n<br />\n<br />\n<b>\nThanks!  #MailFooter#</b>', 'Manual Taxi Dispatch Details', '<b>Dear #Driver#,</b><br />\n<br />\nYou are assigned to ride with <b>#Rider#.</b><br />\n<br />\nBelow is the details.<br />\n<br />\n<b>Rider Name :</b> #Rider#<br />\n<br />\n<b>Booking No :</b> #BookingNo#<br />\n<br />\n<b>From Address :</b> #SourceAddress#<br />\n<br />\n<b>To Address :</b> #DestinationAddress#<br />\n<br />\n<b>Booking Date :</b> #Ddate#<br />\n<br />\n<br />\n<b>\nThanks!  #MailFooter#</b>'),
(39, 'MANUAL_TAXI_DISPATCH_RIDER', 'html', 'Job Seeker', 'Active', 'Your booking details', '<b>Dear #Rider#,</b><br />\n<br />\nYou have booked #Driver# for beautician service.</b><br />\n<br />\nBelow is the details.<br />\n<br />\n<b>Driver Name :</b> #Driver#<br />\n<br />\n<b>Booking No :</b> #BookingNo#<br />\n<br />\n<b>From Address :</b> #SourceAddress#<br />\n<br />\n<b>To Address :</b> #DestinationAddress#<br />\n<br />\n<b>Booking Date :</b> #Ddate#<br />\n<br />\n<br />\n<b>\nThanks!  #MailFooter#</b>', 'Manual Taxi Dispatch Details', '<b>Dear #Rider#,</b><br />\n<br />\nYou are assigned to ride with <b>#Driver#.</b><br />\n<br />\nBelow is the details.<br />\n<br />\n<b>Driver Name :</b> #Driver#<br />\n<br />\n<b>Booking No :</b> #BookingNo#<br />\n<br />\n<b>From Address :</b> #SourceAddress#<br />\n<br />\n<b>To Address :</b> #DestinationAddress#<br />\n<br />\n<b>Booking Date :</b> #Ddate#<br />\n<br />\n<br />\n<b>\nThanks!  #MailFooter#</b>'),
(40, 'WITHDRAWAL_MONEY_REQUEST_ADMIN', 'html', 'Job Seeker', 'Active', 'Withdrawal Money Request', '<b>Dear Administrator,</b><br />\n<br />\n#User_Name# has requested to withdrawl money<br />\n<br />\nBelow is the details.<br />\n<br />\n<b>Account Holder Name :</b> #Account_Name#<br />\n<br />\n<b>Phone :</b> #User_Phone#<br />\n<br />\n<b>Email :</b> #User_Email#<br />\n<br />\n<b>Bank Name :</b> #Bank_Name#<br />\n<br />\n<b>Account Number:</b> #Account_Number#<br />\n<br />\n<b>BIC/SWIFT Code :</b> #BIC/SWIFT_Code#<br />\n<br />\n<b>Bank Branch:</b> #Bank_Branch#<br />\n<br />\n<b>\nWithdrawal Amount :</b> #Withdrawal_amount#<br />\n<br /></br>\nThanks!  #MailFooter#', 'Withdrawal Money Request', '<b>Dear Administrator,</b><br />\n<br />\n#User_Name# has requested to withdrawl money<br />\n<br />\nBelow is the details.<br />\n<br />\n<b>Account Holder Name :</b> #Account_Name#<br />\n<br />\n<b>Phone :</b> #User_Phone#<br />\n<br />\n<b>Email :</b> #User_Email#<br />\n<br />\n<b>Bank Name :</b> #Bank_Name#<br />\n<br />\n<b>Account Number:</b> #Account_Number#<br />\n<br />\n<b>BIC/SWIFT Code :</b> #BIC/SWIFT_Code#<br />\n<br />\n<b>Bank Branch:</b> #Bank_Branch#<br />\n<br />\n<b>\nWithdrawal Amount :</b> #Withdrawal_amount#<br />\n<br /></br>\nThanks!  #MailFooter#'),
(41, 'WITHDRAWAL_MONEY_REQUEST_USER', 'html', 'Job Seeker', 'Active', 'Withdrawal Money Request', '<b>Dear #User_Name#,</b><br />\r\n<br />\r\nYou have requested to <b>#Withdrawal_amount#</b> withdrawl amount. Admin will contact you as soon as possible.\r\n<br /></br>\r\nThanks!  #MailFooter#', 'Withdrawal Money Request', '<b>Dear #User_Name#,</b><br />\n<br />\nYou have requested to <b>#Withdrawal_amount#</b> withdrawl amount. Admin will contact you as soon as possible.\n<br /></br>\nThanks!  #MailFooter#'),
(42, 'APP_EMAIL_VERIFICATION_USER', 'html', 'Job Seeker', 'Active', 'Email verification on nexfret', '<p>Dear&nbsp; #NAME#,</p><br /><p>Thank you&nbsp;for verifying your Email Account.<br /><br />To Activate Your E-mail Use this code:#CODE#</p><br /><p>#MAIL_FOOTER#</p>', 'Email verification on nexfret', '<p>Dear&nbsp; #NAME#,</p><br /><p>Thank you&nbsp;for verifying your Email Account.<br /><br />To Activate Your E-mail Use this code:#CODE#</p><br /><p>#MAIL_FOOTER#</p>'),
(43, 'VEHICLE_BOOKING_ADMIN', 'html', 'Job Seeker', 'Active', 'Nexfret - Meus veículos', '<p>Dear Administrator,</p>\r\n<p>New Vehicle is successfully added at nexfret. Packer details are as follows.</p>\r\n<p>Name: #NAME#,</p>\r\n<p>Email: #EMAIL#</p>#details#<p>#MAILFOOTER#</p>', 'Nexfret - Meus veículos', '<p>Dear Administrator,</p>\r\n<p>Um novo veículo foi adicionado a sua conta Nexfret. </p>\r\n<p>Name: #NAME#,</p>\r\n<p>Email: #EMAIL#</p>#details#<p>#MAILFOOTER#</p>');
