(33, 'Privacy Policy', NULL, NULL, '', 'Privacy Policy', 'Privacy Policy', 'Privacy Policy', 'Privacy Policy', 'This Privacy Policy sets out the manner in which V3Cube Technolabs LLP (V3Cube.com) will collect, hold and protect information about you when you use our website and /or mobile application to test our Demo Apps.<br />\r\n<br />\r\na. We may disclose to third party services certain personally identifiable information listed below:<br />\r\n- Information you provide us such as below :  <br />\r\n--- name<br />\r\n--- email<br />\r\n--- mobile phone number<br />\r\n--- demographic information<br />\r\n--- information we collect as you access and use our service, including device information, location and network carrier<br />\r\n<br />\r\n- This information is shared with third party service providers so that we can:<br />\r\n--- personalize the app for you<br />\r\n--- perform behavioral analytics<br />\r\n--- improve our products and services<br />\r\n--- To periodically send promotional emails about new products, special offers or other information which we think you may find interesting using the email address which you have provided.<br />\r\n<br />\r\nb. Security<br />\r\n- We are committed to ensuring that your information is secure.<br />\r\n- In order to prevent unauthorized access or disclosure we have put in place suitable physical, electronic and managerial procedures to safeguard and secure the information we collect online. <br />\r\n<br />\r\nc. Third Party Website Links<br />\r\n- Our website may contain links to other websites. However, once you have used these links to leave our site, you should note that we do not have any control over those websites. Therefore, we cannot be responsible for the protection and privacy of any information which you provide to those websites.<br />\r\n- We will not sell, distribute or lease your personal information to third parties unless we have your permission or are required by law to do so.<br />\r\n- If you believe that any information we are holding on you is incorrect or incomplete, please write to or email us as soon as possible at the sales@v3cube.com email address. We will promptly correct any information found to be incorrect.', 'Política de Privacidade', 'This Privacy Policy sets out the manner in which V3Cube Technolabs LLP (V3Cube.com) will collect, hold and protect information about you when you use our website and /or mobile application to test our Demo Apps.<br />\r\n<br />\r\na. We may disclose to third party services certain personally identifiable information listed below:<br />\r\n- Information you provide us such as below :  <br />\r\n--- name<br />\r\n--- email<br />\r\n--- mobile phone number<br />\r\n--- demographic information<br />\r\n--- information we collect as you access and use our service, including device information, location and network carrier<br />\r\n<br />\r\n- This information is shared with third party service providers so that we can:<br />\r\n--- personalize the app for you<br />\r\n--- perform behavioral analytics<br />\r\n--- improve our products and services<br />\r\n--- To periodically send promotional emails about new products, special offers or other information which we think you may find interesting using the email address which you have provided.<br />\r\n<br />\r\nb. Security<br />\r\n- We are committed to ensuring that your information is secure.<br />\r\n- In order to prevent unauthorized access or disclosure we have put in place suitable physical, electronic and managerial procedures to safeguard and secure the information we collect online. <br />\r\n<br />\r\nc. Third Party Website Links<br />\r\n- Our website may contain links to other websites. However, once you have used these links to leave our site, you should note that we do not have any control over those websites. Therefore, we cannot be responsible for the protection and privacy of any information which you provide to those websites.<br />\r\n- We will not sell, distribute or lease your personal information to third parties unless we have your permission or are required by law to do so.<br />\r\n- If you believe that any information we are holding on you is incorrect or incomplete, please write to or email us as soon as possible at the sales@v3cube.com email address. We will promptly correct any information found to be incorrect.', 'Active'),
