(23, 'HomePage-First', NULL, NULL, '', '', '', '', 'Packing And Moving Services For Everyplace, Anytime', '<p>Whether it is residential or office relocation, vehicle transportation, loading and unloading or even just shifting things around a bit , our efficient packers and movers will be ready to do your bidding, anytime, anywhere to anyplace. Urgent or pre-booked services all will be delivered to you by our dedicated team.</p>', 'Empacotando e movendo serviços para Everyplace, Anytime', '<p>Se é realocação residencial ou de escritório, transporte de veículo, carregando e descarregando ou mesmo apenas trocando coisas em torno de um bocado, nossos empacotadores e motores eficientes estarão prontos para fazer seu oferecimento, a qualquer hora, em qualquer lugar a em qualquer lugar. Serviços urgentes ou pré-agendados todos serão entregues a você por nossa equipe dedicada.</p>', 'Active'),
