(24, 'HomePage-Second', NULL, 'img1_20170426222432.jpg', 'home-img3_20160610190806.jpg', '', '', '', 'Vetted, Effiecient', '<h2>And Professional</h2>\r\n\r\n<p>All our packers and movers are carefully vetted, with full background checks done on each one, thoroughly reviewed and supported by a commercial insurance agency. You can trust us to efficiently and professional move your belongings, whatever it is, wherever it is.</p>', 'Vetted, Eficiente', '<h2>E profissional</h2>\r\n\r\n<p>Todos os nossos empacotadores e motores s&atilde;o cuidadosamente examinados, com verifica&ccedil;&otilde;es de antecedentes completo feito em cada um, cuidadosamente revisto e apoiado por uma ag&ecirc;ncia de seguros comerciais. Voc&ecirc; pode confiar em n&oacute;s para eficiente e profissional mover seus pertences, seja qual for, onde quer que esteja.</p>', 'Active'),
(25, 'HomePage-Third', NULL, 'img2_20170426222309.jpg', 'home-img5_20160610191242.jpg', '', '', '', 'Affordable And', '<h2>Convenient Movers</h2>\r\n\r\n<p>You will not have to pay exorbitant prices for our movers to come and do their job, like you would for the other companies that are in the same business. With our services you get value for money and more. The packing material we use is of superior quality. We ensure that your valuables are looked after and stored properly whilst in transit and that they reach their destination in the same condition that they were before being moved.</p>', 'Acessível e', '<h2>Motores Convenientes</h2>\r\n\r\n<p>Voc&ecirc; n&atilde;o ter&aacute; que pagar pre&ccedil;os exorbitantes para os nossos motores para vir e fazer o seu trabalho, como voc&ecirc; faria para as outras empresas que est&atilde;o no mesmo neg&oacute;cio. Com os nossos servi&ccedil;os voc&ecirc; tem valor para o dinheiro e muito mais. O material de embalagem que usamos &eacute; de qualidade superior. N&oacute;s garantimos que seus objetos de valor s&atilde;o cuidados e armazenados adequadamente enquanto em tr&acirc;nsito e que eles chegam ao seu destino na mesma condi&ccedil;&atilde;o que eles estavam antes de ser movido.</p>', 'Active'),
(26, 'HomePage-Forth', NULL, 'img3_20170426222443.jpg', '', '', '', '', 'Cashless And On Your Schedule', '<h2>The Perfect Moving Experience</h2>\r\n\r\n<p>We have no delivery windows &ndash; we make the window as per your requirements. That is why we are always at your service day or night. You just tell us the time and we will be there. What&rsquo;s more, you need not worry about payments either, as the whole process is cashless, thanks to the automatic payment system. There are no hidden charges either. You pay exactly what was quoted to you. A move that is virtually hassle free.</p>', 'Cashless e em sua programação', '<h2>A experi&ecirc;ncia de movimenta&ccedil;&atilde;o perfeita</h2>\r\n\r\n<p>N&oacute;s n&atilde;o temos janelas de entrega - n&oacute;s fazemos a janela como por suas exig&ecirc;ncias. &Eacute; por isso que estamos sempre ao seu servi&ccedil;o dia ou noite. Voc&ecirc; apenas nos diga o tempo e n&oacute;s estaremos l&aacute;. Al&eacute;m do mais, voc&ecirc; n&atilde;o precisa se preocupar com pagamentos tamb&eacute;m, como todo o processo &eacute; cashless, gra&ccedil;as ao sistema de pagamento autom&aacute;tico. N&atilde;o h&aacute; taxas escondidas. Voc&ecirc; paga exatamente o que foi citado para voc&ecirc;. Um movimento que &eacute; praticamente livre de problemas.</p>', 'Active'),
